/**
 * meta信息解析
 */
export default class AMFParser {
    offset: number;
    readOffset: number;
    resolve(meta: any, size: any): {};
    resetStatus(): void;
    parseString(buffer: any): {
        data: string;
        bodySize: number;
    };
    parseDate(buffer: any, size: any): {
        data: Date;
        bodySize: number;
    };
    parseObject(buffer: any, size: any): {
        data: {
            name: string;
            value: any;
        };
        bodySize: any;
        isObjEnd: any;
    };
    parseLongString(buffer: any): {
        data: string;
        bodySize: number;
    };
    /**
     * 解析meta中的变量
     */
    parseValue(data: any, size: any): any;
}
